import React from "react";

function Circle({ color, active, handleClick }) {
  return (
    <button
      className={`circle ${active ? "active" : ""}`}
      style={{ backgroundColor: color }}
      onClick={() => handleClick(color)}
    >
      {active && ""}
    </button>
  );
}

export default Circle;
